void convertForcesToBendingModes(float* a, float* b, float* o, int size) {
    // This is matrix multiplication where
    // a -> actuator forces
    // b -> matrix that has already been transposed
    // o -> output
    // size -> number of actuators
    for(int i = 0; i < VECTOR_SIZE; ++i) {
        (*o) = 0.0f;
        float* left = a;
        for(int j = 0; j < ACTUATORS; ++j) {
            (*o) += (*left) * (*b);
            ++left;
            ++b;
        }
        ++o;
    }
}

void convertBendingModesToForces(float* a, float* b, float* o) {
    // This is matrix multiplication where
    // a -> bending mode coefficients
    // b -> matrix
    // o -> output
    // size -> number of actuators
    for(int i = 0; i < ACTUATORS; ++i) {
        (*o) = 0.0f;
        float* left = a;
        for(int j = 0; j < VECTOR_SIZE; ++j) {
            (*o) += (*left) * (*b);
            ++left;
            ++b;
        }
        ++o;
    }
}

void calculateStress(float* coeff, float* scale, float* stress, float* aMax, int* aMaxIndex, float* bMin, int* bMinIndex, float* cMax, int* cMaxIndex, float* dMin, int* dMinIndex) {
    // Multiply coeff and scale
    float coeffScale[VECTOR_SIZE];
    float* output = coeffScale;
    for(int i = 0; i < VECTOR_SIZE; ++i) {
        (*output) = (*coeff) * (*scale);
        ++coeff;
        ++scale;
        ++output;
    }

    // Offset stress table for each 2D normal stress value 
    // X/Y/XY for the top and bottom surfaces
    float* Xtop = stress;
    float* Ytop = stress + 1;
    float* XYtop = stress + 2;
    float* Xbot = stress + 3;
    float* Ybot = stress + 4;
    float* XYbot = stress + 5;

    // Initializes the min/max stress values
    *aMax = FLT_MIN;
    *aMaxIndex = -1;
    *bMin = FLT_MAX;
    *bMinIndex = -1;
    *cMax = FLT_MIN;
    *cMaxIndex = -1;
    *dMin = FLT_MAX;
    *dMinIndex = -1;

    for(int r = 0; r < REPLICATE_ROW_SIZE; ++r) {
        // Reset the scalar memory location
        float* scalar = coeffScale;

        // Initialize the accumulators
        float sumXtop = 0;
        float sumYtop = 0;
        float sumXYtop = 0;
        float sumXbot = 0;
        float sumYbot = 0;
        float sumXYbot = 0;

        // Scale each 2D normal stress value and accumulate their values
        for(int i = 0; i < VECTOR_SIZE; ++i) {
            sumXtop += (*Xtop) * (*scalar);
            sumYtop += (*Ytop) * (*scalar);
            sumXYtop += (*XYtop) * (*scalar);
            sumXbot += (*Xbot) * (*scalar);
            sumYbot += (*Ybot) * (*scalar);
            sumXYbot += (*XYbot) * (*scalar);
            Xtop += INTERVAL;
            Ytop += INTERVAL;
            XYtop += INTERVAL;
            Xbot += INTERVAL;
            Ybot += INTERVAL;
            XYbot += INTERVAL;
            ++scalar;
        }

        // Calculate A_majorPrinTop, B_minorPrinTop, C_majorPrinBot, and D_minorPrinBot
        float a = 0.5f*((sumXtop+sumYtop)+sqrtf((sumXtop-sumYtop)*(sumXtop-sumYtop)+(4*sumXYtop*sumXYtop)));
        float b = 0.5f*((sumXtop+sumYtop)-sqrtf((sumXtop-sumYtop)*(sumXtop-sumYtop)+(4*sumXYtop*sumXYtop)));
        float c = 0.5f*((sumXbot+sumYbot)+sqrtf((sumXbot-sumYbot)*(sumXbot-sumYbot)+(4*sumXYbot*sumXYbot)));
        float d = 0.5f*((sumXbot+sumYbot)-sqrtf((sumXbot-sumYbot)*(sumXbot-sumYbot)+(4*sumXYbot*sumXYbot)));

        // Keep track of min/max A/B/C/D values
        if(a > *aMax) {
            *aMax = a;
            *aMaxIndex = r;
        }
        if(b < *bMin) {
            *bMin = b;
            *bMinIndex = r;
        }
        if(c > *cMax) {
            *cMax = c;
            *cMaxIndex = r;
        }
        if(d < *dMin) {
            *dMin = d;
            *dMinIndex = r;
        }
    }
}

